import React from "react";

function Torero(){
    return(
        <>
<iframe
  title="Spotify Embed: Recommendation Playlist "
  src={`https://open.spotify.com/intl-es/embed/album/51dg2LdYMIVQqCuUBlfQsN?si=asdMvJpgRPmDictRaky9DA`}
//   src={`https://open.spotify.com/embed/playlist/4d7JtovGW5iCH9KdWpHTyd?utm_source=generator&theme=0`}
  width="100%"
  height="200%"
  style={{ minHeight: '900px' }}
  frameBorder="0"
  allow="autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture"
  loading="lazy"
/>

        </>
    )
}
export default Torero;
